// main.js
import { createApp } from 'vue';
import App from './App.vue';
import LoginForm from "./components/Login.vue";  // Rename to follow PascalCase
import Dashboard from "./components/AttendanceForm.vue";  // Rename to follow PascalCase
import Navigation from "./components/TheNavigation.vue"  // Rename to follow PascalCase
import Leave from "./components/LeaveForm.vue";  // Rename to follow PascalCase
import AttendanceLevel from "./components/AttendanceLevel.vue";  // Rename to follow PascalCase

import { createRouter, createWebHistory } from 'vue-router';

const routes = [
  {
    path: '/',
    component: LoginForm,
    name: 'login',
  },
  {
    path: '/dashboard',
    component: Dashboard,
    name: 'dashboardForm',
    props: true,
  },
  {
    path: '/navigation',
    component: Navigation,
    name: 'navigation',
  },
  {
    path: "/leave",
    component: Leave,
  },
  {
    path: "/attendanceLevel",
    component: AttendanceLevel,
  }
];

const router = createRouter({
  history: createWebHistory(),
  linkActiveClass: 'active-link',
  routes,
});

const app = createApp(App);
app.use(router);
app.component('LoginForm', LoginForm);
app.component('DashboardForm', Dashboard);
app.mount('#app');
